import React, {Component} from 'react';
import './App.css';
import Navabr from './components/Navbar'

class App extends Component {


    state = {

        item:[
            {name:'Xikmatilla', age: 22, sex: "M"},
        ]
    };


    render() {

        return (
            <div className="App">
                <h1>Salomlar do'slar</h1>
                <Navabr name='Xikmatilla' age='x22' bilet='black'/>

            </div>
        );
    }
}

export default App;
